const airports = data["airports"]
const flights = data["flights"]

console.log("flights", flights);

let isOneWay = false;

function createOption(attributes, innerHTML) {
    const option = document.createElement("option");
    for (const [key, value] of Object.entries(attributes)) {
        option.setAttribute(key, value);
    }
    
    option.appendChild(innerHTML);
    return option;
}

function constructAirportDropdowns() {
    function fillAirports(dropdown) {
        airports.forEach(airport => {
            const option = createOption({value: airport.code, class: "airport-list"}, document.createTextNode(`${airport.code} - ${airport.name}`));
            dropdown.appendChild(option);
        });
    }

    const dropdowns = document.getElementsByClassName("airport-dropdown");
    for (let dropdown of dropdowns) {
        fillAirports(dropdown);
    }
}

function setupDatePickers() {
    const datePickers = document.getElementsByClassName("date-picker");
    for (let datePicker of datePickers) {
        datePicker.min = new Date().toISOString().slice(0, -14);
    }
}

function onDepartureDateChange() {
    const departureDate = document.getElementById("departureDate");
    const returnDate = document.getElementById("returnDate");

    returnDate.value = null;
    returnDate.min = new Date(departureDate.value).toISOString().slice(0, -14);
}

function onOneWayChange() {
    const oneWay = document.getElementById("oneWay");
    const returnDate = document.getElementById("returnDate");
    
    isOneWay = oneWay.checked;

    returnDate.value = null;
    if (isOneWay) {
        returnDate.setAttribute("disabled", true);
    } else {
        returnDate.removeAttribute("disabled");
    }
}

function compareTimes(time1,time2){
    let val1 = parseInt(time1.slice(0,2));
    let val2 = parseInt(time2.slice(0,2));

    if(val1 ===val2){
        val1 = parseInt(time1.slice(3,5));
        val2 = parseInt(time2.slice(3,5));
        return val1-val2;
    
    }
    return val1-val2;
}

function findFlights() {
    const from = document.getElementById("departureAirport").value;
    const to = document.getElementById("arrivalAirport").value;

    if (from === to) {
        return [[], []];
    }
    
    const departureDate = document.getElementById("departureDate").value;
    const returnDateElement = document.getElementById("returnDate");

    let departingFlights = flights.filter(flight => flight.from === from && flight.to === to && flight.date === departureDate);
    departingFlights = departingFlights.sort((flight1,flight2) => compareTimes(flight1.time,flight2.time));
    
    if(departingFlights.length === 0){
        return [[],[]];
    }
    
    if (!isOneWay) {
        const returnDate = returnDateElement.value;
        let returningFlights = flights.filter(flight => flight.from === to && flight.to === from && flight.date === returnDate);
        if(returningFlights.length === 0){
            return [[],[]];
        }
        return [departingFlights, returningFlights];
    }
    return [departingFlights, []];
}

function createTr(datum) {
    const fromTd = document.createElement("td");
    const toTd = document.createElement("td");
    const dateTd = document.createElement("td");
    const timeTd = document.createElement("td");

    fromTd.innerText = datum["from"];
    toTd.innerText = datum["to"];
    dateTd.innerText = datum["date"];
    timeTd.innerText = datum["time"];

    const tr = document.createElement("tr");
    tr.appendChild(fromTd);
    tr.appendChild(toTd);
    tr.appendChild(dateTd);
    tr.appendChild(timeTd);

    tr.setAttribute("class", "data-created");

    return tr;
}

function clearTables() {
    var elements = document.getElementsByClassName("data-created");
    while (elements[0]) {
        elements[0].parentNode.removeChild(elements[0]);
    }
    document.querySelectorAll("table").forEach(table => table.setAttribute("hidden", true));
}

function fillTables(departingData, returningData) {
    clearTables();

    const departureTable = document.getElementById("departureTable");
    const returnTable = document.getElementById("returnTable");

    if (departingData.length === 0) {
        alert("There's no flights in selected dates / airports.");
        return;
    }

    departingData.forEach(datum => {
        const tr = createTr(datum);
        departureTable.appendChild(tr);
    });
    departureTable.removeAttribute("hidden");

    if (returningData.length !== 0) {
        returningData.forEach(datum => {
            const tr = createTr(datum);
            returnTable.appendChild(tr);
        });
        returnTable.removeAttribute("hidden");
    }
}

function animateLoading(callback) {
    const loadingDiv = document.getElementById("loadingIndicator");
    loadingDiv.removeAttribute("hidden");

    setTimeout(() => {
        callback();
        loadingDiv.setAttribute("hidden", true);
    }, 1000);
}

function search() {
    const [departingFlights,returningFlights] = findFlights();
    fillTables(departingFlights,returningFlights);
}

function onSubmit() {
    animateLoading(search);
}

function init() {
    constructAirportDropdowns();
    setupDatePickers();
}

init();
